const gradeName = ["一年", "二年", "三年", "四年", "五年", "六年", undefined, "中学", "人名用", "人名用"];

(function() {
    'use strict';

    // figure out the details of this bad boy
    const characterElement = $("#character");

    if (characterElement.length == 0) { // kanji page
    	// get kanji details
        const kanji = characterElement.length == 0 ? document.title.charAt(document.title.length - 1) : characterElement.html();
        const info = wk_info_dict[kanji];
        const pinyin = info[0] == "" ? "None" : info[0];
        const grade = info[1] == null ? "Not taught in schools" : gradeName[info[1]-1];
        const freq = info[2] == null ? "Not in top 2500" : "#"+info[2];
        const jlpt = info[3] == null ? "Not in JLPT" : "N"+info[3];

        if (info != undefined) {
            // set grade, freq, and jlpt information
            $("section#information > div").wrapAll("<div class=\"row remove-margin-bottom\"><div class=\"span6 remove-margin-bottom\"></div></div>");
            $("section#information div.span6").after("<div class=\"span6 remove-margin-bottom\"><div class=\"alternative-meaning\"><h2>School Grade</h2><p class=\"remove-margin-bottom\">" + grade + "</p></div><div class=\"alternative-meaning\"><h2>Frequency</h2><p class=\"remove-margin-bottom\">" + freq + "</p></div><div class=\"alternative-meaning\"><h2>JLPT</h2><p class=\"remove-margin-bottom\">" + jlpt + "</p></div></div>");

            // update readings
            const sectionListing = $("section#note-reading").parent().parent();
            const sections = sectionListing.children();

            for (var i = 0; i < sections.length; i++) {
                const child = sections[i];
                if (child.children && child.children.length > 0) {
                    if (child.children[0].textContent === "Readings") {
                        const readings = child.children[1].children;
                        // resize lame old readings
                        for (var j = 0; j < readings.length; j++) {
                            const reading = readings[j];
                            const oldClass = reading.getAttribute("class");
                            reading.setAttribute("class", oldClass.replace("span4", "span3"));
                        }

                        // insert the spicy new pinyin reading
                        $(readings[2]).after($("<div class=\"span3 muted-content\"><h3>Mandarin</h3><p lang=\"zh\">" + pinyin + "</p></div>"));
                    }
                }
            }
        }
    } else { // lesson page
        // add kanji info box
        $("#progress-bar").after("<div id=\"wk-kanji-info\" style=\"position: absolute;top: 50px;left: 20px;background-color: rgba(239, 239, 239, 0.75);border-radius: 3px;padding: 8px 12px;color: rgba(0, 0, 0, 0.7);font-size: .83em;display: grid;grid-template: 1fr 1fr 1fr / 1fr 1fr;\"></div>");

        // update kanji info box function
        const updateKanjiInfo = function() {
            if ($("#main-info").attr("class") === "kanji") { // if kanji
            	// show info box
                $("#wk-kanji-info").toggle(true);
                // get kanji details
                const kanji = characterElement.html();
                const info = wk_info_dict[kanji];
                const pinyin = info[0] == "" ? "None" : info[0];
                const grade = info[1] == null ? "Not taught in schools" : gradeName[info[1]-1];
                const freq = info[2] == null ? "Not in top 2500" : "#"+info[2];
                const jlpt = info[3] == null ? "Not in JLPT" : "N"+info[3];
                // set info box content
                var constructedOutput = "";
                const addLine = function(label, value) {
                	constructedOutput += "<span style=\"font-weight: bold;\">" + label + "</span><span style=\"padding-left: 10px;\">" + value + "</span>";
                };
                addLine("Grade", grade);
                addLine("Freq", freq);
                addLine("JLPT", jlpt);
                $("#wk-kanji-info").html(constructedOutput);
            } else { // if not kanji (i.e. radical or vocab)
            	// hide info box
                $("#wk-kanji-info").toggle(false);
            }
        };

        // set kanji info box contents for first lesson item
        updateKanjiInfo();

        // setup observer to change kanji info box contents for subsequent items
        var observer = new MutationObserver(function(mutations) {
            updateKanjiInfo();
        });
        var config = { attributes: true, childList: true, characterData: true };
        observer.observe(characterElement.get(0), config);
    }
})();
